             retry: false,\n                    },\n                },\n            })\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n\n            axiosMock.onGet(\"/api/admin/users\").reply(404);\n\n            const { result, waitFor } = renderHook(() => useBackend(\n                [\"/api/admin/users\"],\n                { method: \"GET\", url: \"/api/admin/users\" },\n                [\"initialData\"]\n            ), { wrapper });\n\n            await waitFor(() => result.current.isError);\n\n            expect(result.current.data).toEqual([\"initialData\"]);\n            await waitFor(() => expect(mockToast).toHaveBeenCalledTimes(1));\n            expect(mockToast).toHaveBeenCalledWith(\"Error communicating with backend via GET on /api/admin/users\");\n\n            console.error.mockRestore();\n        });\n\n    });\n    describe(\"utils/useBackend useBackendMutation tests\", () => {\n        test(\"useBackendMutation handles success correctly\", async () => {\n            // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n            const queryClient = new QueryClient({\n                defaultOptions: {\n                    queries: {\n                        //  turns retries off\n                        retry: false,\n                    },\n                },\n            })\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n\n            axiosMock.onPost(\"/api/ucsbdates/post\").reply(202, {\n                id: 17,\n                quarterYYYYQ: '20221',\n                name: 'Groundhog Day',\n                localDateTime: '2022-02-02T12:00'\n\n            });\n\n\n            const objectToAxiosParams = (ucsbDate) => ({\n                url: \"/api/ucsbdates/post\",\n                method: \"POST\",\n                params: {\n                    quarterYYYYQ: ucsbDate.quarterYYYYQ,\n                    name: ucsbDate.name,\n                    localDateTime: ucsbDate.localDateTime\n                }\n            });\n\n            const onSuccess = jest.fn().mockImplementation((ucsbDate) => {\n                mockToast(`New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`);\n            });\n\n            const { result, waitFor } = renderHook(\n                () => useBackendMutation(objectToAxiosParams, { onSuccess }, [\"/api/ucsbdates/all\"]), { wrapper }\n            );\n\n            const mutation = result.current;\n            act(() => mutation.mutate({\n                quarterYYYYQ: '20221',\n                name: 'Groundhog Day',\n                localDateTime: '2022-02-02T12:00'\n            }));\n\n\n            await waitFor(() => expect(onSuccess).toHaveBeenCalled());\n            expect(mockToast).toHaveBeenCalledWith(\"New ucsbDate Created - id: 17 name: Groundhog Day\");\n\n        });\n\n        test(\"useBackendMutation handles error correctly with response message\", async () => {\n            jest.spyOn(console, 'error')\n            console.error.mockImplementation(() => null);\n            \n            // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n            const queryClient = new QueryClient({\n                defaultOptions: {\n                    queries: {\n                        //  turns retries off\n                        retry: false,\n                    },\n                },\n            })\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onPost(\"/api/ucsbdates/post\").reply(404, { message: \"Error: Request failed with status code 404\" });\n\n            const objectToAxiosParams = (ucsbDate) => ({\n                url: \"/api/ucsbdates/post\",\n                method: \"POST\",\n                params: {\n                    quarterYYYYQ: ucsbDate.quarterYYYYQ,\n                    name: ucsbDate.name,\n                    localDateTime: ucsbDate.localDateTime\n                }\n            });\n\n            const onSuccess = jest.fn().mockImplementation((ucsbDate) => {\n                mockToast(`New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`);\n            });\n\n            const { result, waitFor } = renderHook(\n                () => useBackendMutation(objectToAxiosParams, { onSuccess }), { wrapper }\n            );\n\n            const mutation = result.current;\n\n            mutation.mutate({\n                quarterYYYYQ: '20221',\n                name: 'Groundhog Day',\n                localDateTime: '2022-02-02T12:00'\n            });\n\n            await waitFor(() => expect(mockToast).toHaveBeenCalledTimes(1));\n            expect(mockToast).toHaveBeenCalledWith(\"Error: Request failed with status code 404\");\n\n            console.error.mockRestore();\n        });\n\n        test(\"useBackendMutation handles error correctly with no response message\", async () => {\n            jest.spyOn(console, 'error')\n            console.error.mockImplementation(() => null);\n\n            // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n            const queryClient = new QueryClient({\n                defaultOptions: {\n                    queries: {\n                        //  turns retries off\n                        retry: false,\n                    },\n                },\n            })\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onPost(\"/api/ucsbdates/post\").reply(404);\n\n            const objectToAxiosParams = (ucsbDate) => ({\n                url: \"/api/ucsbdates/post\",\n                method: \"POST\",\n                params: {\n                    quarterYYYYQ: ucsbDate.quarterYYYYQ,\n                    name: ucsbDate.name,\n                    localDateTime: ucsbDate.localDateTime\n                }\n            });\n\n            const onSuccess = jest.fn().mockImplementation((ucsbDate) => {\n                mockToast(`New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`);\n            });\n\n\n            const { result, waitFor } = renderHook(\n                () => useBackendMutation(objectToAxiosParams, { onSuccess }), { wrapper }\n            );\n\n            const mutation = result.current;\n\n            mutation.mutate({\n                quarterYYYYQ: '20221',\n                name: 'Groundhog Day',\n                localDateTime: '2022-02-02T12:00'\n\n            });\n            await waitFor(() => expect(mockToast).toHaveBeenCalledTimes(1));\n            expect(mockToast).toHaveBeenCalledWith(\"Error communicating with backend via post on /api/ucsbdates/post\");\n            \n            console.error.mockRestore();\n        });\n    });\n});\n"},"src/tests/utils/currentUser.test.js":{"tests":[{"id":"5","name":"utils/currentUser tests useCurrentUser tests useCurrentUser retrieves initial data","location":{"start":{"column":10,"line":18}}},{"id":"6","name":"utils/currentUser tests useCurrentUser tests useCurrentUser retrieves data from API","location":{"start":{"column":10,"line":48}}},{"id":"7","name":"utils/currentUser tests useCurrentUser tests useCurrentUser when API unreachable","location":{"start":{"column":10,"line":68}}},{"id":"8","name":"utils/currentUser tests useCurrentUser tests useCurrentUser handles missing roles correctly","location":{"start":{"column":10,"line":92}}},{"id":"9","name":"utils/currentUser tests useLogout tests useLogout","location":{"start":{"column":10,"line":120}}},{"id":"10","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_ADMIN\") return falsy when currentUser ill-defined","location":{"start":{"column":10,"line":152}}},{"id":"11","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_ADMIN\") returns correct values when currentUser properly defined","location":{"start":{"column":10,"line":162}}}],"source":"import { renderHook } from '@testing-library/react-hooks';\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"jest-mock-console\";\nimport { act } from 'react-dom/test-utils';\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { useNavigate } from \"react-router-dom\";\n\nimport { useCurrentUser, useLogout, hasRole } from \"main/utils/currentUser\";\nimport { apiCurrentUserFixtures, currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\njest.mock('react-router-dom');\nconst { MemoryRouter } = jest.requireActual('react-router-dom');\n\ndescribe(\"utils/currentUser tests\", () => {\n    describe(\"useCurrentUser tests\", () => {\n        test(\"useCurrentUser retrieves initial data\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/currentUser\").timeoutOnce();\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n\n            const restoreConsole = mockConsole();\n\n            const { result, waitFor } = renderHook(() => useCurrentUser(), { wrapper });\n            await waitFor(() => result.current.isSuccess);\n\n            expect(result.current.data).toEqual({ loggedIn: false, root: null, initialData:true });\n            \n            const queryState = queryClient.getQueryState(\"/api/currentUser\");\n            expect(queryState).toBeDefined();\n\n            queryClient.clear();\n\n            await waitFor( ()=> expect(console.error).toHaveBeenCalled() );\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error invoking axios.get:/);\n            restoreConsole();\n        });\n\n        test(\"useCurrentUser retrieves data from API\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n\n            const { result, waitFor } = renderHook(() => useCurrentUser(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n           \n            expect(result.current.data).toEqual(currentUserFixtures.userOnly);\n            queryClient.clear();\n        });\n\n        test(\"useCurrentUser when API unreachable\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/currentUser\").reply(404)\n\n            const restoreConsole = mockConsole();\n            const { result, waitFor } = renderHook(() => useCurrentUser(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n            expect(console.error).toHaveBeenCalled();\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error invoking axios.get:/);\n            restoreConsole();\n\n            expect(result.current.data).toEqual({ loggedIn: false, root: null });\n            queryClient.clear();\n        });\n\n        test(\"useCurrentUser handles missing roles correctly\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const apiResult = apiCurrentUserFixtures.missingRolesToTestErrorHandling;\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/currentUser\").reply(200, apiResult);\n\n            const restoreConsole = mockConsole();\n            const { result, waitFor } = renderHook(() => useCurrentUser(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n            expect(console.error).toHaveBeenCalled();\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error getting roles: /);\n            restoreConsole();\n\n            let expectedResult = { loggedIn: true, root: { ...apiResult, rolesList: [\"ERROR_GETTING_ROLES\"] } };\n            expect(result.current.data).toEqual(expectedResult);\n            queryClient.clear();\n        });\n    });\n\n    describe(\"useLogout tests\", () => {\n        test(\"useLogout\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    <"+"MemoryRouter>\n                        {children}\n                    <"+"/MemoryRouter>\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onPost(\"/logout\").reply(200);\n\n            const navigateSpy = jest.fn();\n            useNavigate.mockImplementation(() => navigateSpy);\n\n            const resetQueriesSpy = jest.spyOn(queryClient, 'resetQueries');\n            \n            const { result, waitFor } = renderHook(() => useLogout(), { wrapper });\n\n            act(() => {\n                expect(useNavigate).toHaveBeenCalled();\n                result.current.mutate();\n            });\n            await waitFor(() => expect(navigateSpy).toHaveBeenCalledWith(\"/\"));\n\n            await waitFor(() => expect(resetQueriesSpy).toHaveBeenCalledWith(\"/api/currentUser\", { exact: true }));\n\n            queryClient.clear();\n        });\n    });\n    describe(\"hasRole tests\", () => {\n        test('hasRole(x,\"ROLE_ADMIN\") return falsy when currentUser ill-defined', async () => {\n            expect(hasRole(null, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({}, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: null }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: null }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: {} }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: { rolesList: null } }, \"ROLE_ADMIN\")).toBeFalsy();\n        });\n\n        test('hasRole(x,\"ROLE_ADMIN\") returns correct values when currentUser properly defined', async () => {\n            expect(hasRole({ loggedIn: true, root: { rolesList: [] } }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: { rolesList: [\"ROLE_USER\"] } }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: { rolesList: [\"ROLE_USER\", \"ROLE_ADMIN\"] } }, \"ROLE_ADMIN\")).toBeTruthy();\n        });\n    });\n});\n"},"src/tests/components/Jobs/PagedJobsTable.test.js":{"tests":[{"id":"12","name":"PagedJobsTable tests renders correct content","location":{"start":{"column":4,"line":21}}},{"id":"13","name":"PagedJobsTable tests buttons are disabled where there are zero pages","location":{"start":{"column":4,"line":86}}},{"id":"14","name":"PagedJobsTable tests renders correct content with multiple pages","location":{"start":{"column":4,"line":119}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport PagedJobsTable from \"main/components/Jobs/PagedJobsTable\";\nimport pagedJobsFixtures from \"fixtures/pagedJobsFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\ndescribe(\"PagedJobsTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const testId = \"PagedJobsTable\";\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n  });\n\n  test(\"renders correct content\", async () => {\n\n    // arrange\n\n    axiosMock.onGet(\"/api/jobs/all/pageable\").reply(200, pagedJobsFixtures.onePage);\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PagedJobsTable />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n\n    );\n\n    // assert\n    const expectedHeaders = ['id', 'Created', 'Updated', 'Status', 'Log'];\n    const expectedFields = ['id', 'Created', 'Updated', 'status', 'Log'];\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBe(1);\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(axiosMock.history.get[0].url).toBe(\"/api/jobs/all/pageable\");\n    expect(axiosMock.history.get[0].params).toEqual({ page: 0, size: 10 });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\"\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Created`)\n    ).toHaveTextContent(\"8/8/2023, 12:14:00\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Updated`)\n    ).toHaveTextContent(\"8/8/2023, 12:14:00\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-status`)\n    ).toHaveTextContent(\"complete\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Log`)\n    ).toHaveTextContent(`Updating cow health...Commons Blue, degradationRate: 0.1, carryingCapacity: 10User: Phill Conrad, numCows: 3, cowHealth: 100.0 old cow health: 100.0, new cow health: 100.0User: Phillip Conrad, numCows: 7, cowHealth: 100.0 old cow health: 100.0, new cow health: 100.0Commons Red, degradationRate: 0.1, carryingCapacity: 2User: Phill Conrad, numCows: 10, cowHealth: 54.40000000000016 old cow health: 54.40000000000016, new cow health: 53.600000000000165Cow health has been updated!`);\n\n    expect(screen.getByTestId(`${testId}-header-id-sort-carets`)).toHaveTextContent(\"\");\n\n\n    const nextButton = screen.getByTestId(`${testId}-next-button`);\n    expect(nextButton).toBeInTheDocument();\n    expect(nextButton).toBeDisabled();\n\n    const previousButton = screen.getByTestId(`${testId}-previous-button`);\n    expect(previousButton).toBeInTheDocument();\n    expect(previousButton).toBeDisabled();\n  });\n\n  test(\"buttons are disabled where there are zero pages\", async () => {\n\n    // arrange\n\n    axiosMock.onGet(\"/api/jobs/all/pageable\").reply(200, pagedJobsFixtures.emptyPage);\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PagedJobsTable />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n\n    );\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBe(1);\n    });\n\n    expect(axiosMock.history.get[0].url).toBe(\"/api/jobs/all/pageable\");\n    expect(axiosMock.history.get[0].params).toEqual({ page: 0, size: 10 });\n\n    const nextButton = screen.getByTestId(`${testId}-next-button`);\n    expect(nextButton).toBeInTheDocument();\n    expect(nextButton).toBeDisabled();\n\n    const previousButton = screen.getByTestId(`${testId}-previous-button`);\n    expect(previousButton).toBeInTheDocument();\n    expect(previousButton).toBeDisabled();\n  });\n\n\n  test(\"renders correct content with multiple pages\", async () => {\n    // arrange\n\n    axiosMock.onGet(\"/api/jobs/all/pageable\",  { params: { page: 0, size: 10 } }).reply(200, pagedJobsFixtures.fourPages[0]);\n    axiosMock.onGet(\"/api/jobs/all/pageable\",  { params: { page: 1, size: 10 } }).reply(200, pagedJobsFixtures.fourPages[1]);\n    axiosMock.onGet(\"/api/jobs/all/pageable\",  { params: { page: 2, size: 10 } }).reply(200, pagedJobsFixtures.fourPages[2]);\n    axiosMock.onGet(\"/api/jobs/all/pageable\",  { params: { page: 3, size: 10 } }).reply(200, pagedJobsFixtures.fourPages[3]);\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PagedJobsTable />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n\n    );\n\n    // assert\n    const expectedHeaders = ['id', 'Created', 'Updated', 'Status', 'Log'];\n    const expectedFields = ['id', 'Created', 'Updated', 'status', 'Log'];\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBe(1);\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(axiosMock.history.get[0].url).toBe(\"/api/jobs/all/pageable\");\n    expect(axiosMock.history.get[0].params).toEqual({ page: 0, size: 10 });\n\n    const nextButton = screen.getByTestId(`${testId}-next-button`);\n    expect(nextButton).toBeInTheDocument();\n\n    const previousButton = screen.getByTestId(`${testId}-previous-button`);\n    expect(previousButton).toBeInTheDocument();\n\n    expect(previousButton).toBeDisabled();\n    expect(nextButton).toBeEnabled();\n\n    expect(screen.getByText(`Page: 1`)).toBeInTheDocument();\n    fireEvent.click(nextButton);\n\n    await waitFor(() => {expect(screen.getByText(`Page: 2`)).toBeInTheDocument();});\n    expect(previousButton).toBeEnabled();\n    expect(nextButton).toBeEnabled();\n\n    fireEvent.click(previousButton);\n    await waitFor(() => { expect(screen.getByText(`Page: 1`)).toBeInTheDocument();});\n    expect(previousButton).toBeDisabled();\n    expect(nextButton).toBeEnabled();\n\n    fireEvent.click(nextButton);\n    await waitFor(() => { expect(screen.getByText(`Page: 2`)).toBeInTheDocument();});\n\n    fireEvent.click(nextButton);\n    await waitFor(() => { expect(screen.getByText(`Page: 3`)).toBeInTheDocument();});\n\n    fireEvent.click(nextButton);\n    await waitFor(() => { expect(screen.getByText(`Page: 4`)).toBeInTheDocument();});\n    expect(previousButton).toBeEnabled();\n    expect(nextButton).toBeDisabled();\n  });\n\n});\n\n"},"src/tests/components/Nav/AppNavbar.test.js":{"tests":[{"id":"15","name":"AppNavbar tests renders correctly for regular logged in user","location":{"start":{"column":6,"line":12}}},{"id":"16","name":"AppNavbar tests renders correctly for admin user","location":{"start":{"column":6,"line":27}}},{"id":"17","name":"AppNavbar tests renders correctly for user that hasn't signed in","location":{"start":{"column":6,"line":44}}},{"id":"18","name":"AppNavbar tests renders H2Console and Swagger links correctly","location":{"start":{"column":6,"line":62}}},{"id":"19","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://localhost:3000","location":{"start":{"column":6,"line":81}}},{"id":"20","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://127.0.0.1:3000","location":{"start":{"column":6,"line":100}}},{"id":"21","name":"AppNavbar tests does NOT render the AppNavbarLocalhost when on localhost:8080","location":{"start":{"column":6,"line":119}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport AppNavbar from \"main/components/Nav/AppNavbar\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\ndescribe(\"AppNavbar tests\", () => {\n    const queryClient = new QueryClient();\n\n    test(\"renders correctly for regular logged in user\", async () => {\n        const currentUser = currentUserFixtures.userOnly;\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findByText(\"Welcome, cgaucho\")).toBeInTheDocument();\n    });\n\n    test(\"renders correctly for admin user\", async () => {\n        const currentUser = currentUserFixtures.adminUser;\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findByText(\"Welcome, pconrad\")).toBeInTheDocument();\n        const adminMenu = screen.getByTestId(\"appnavbar-admin-dropdown\");\n        expect(adminMenu).toBeInTheDocument();        \n    });\n\n    test(\"renders correctly for user that hasn't signed in\", async () => {\n        const currentUser = currentUserFixtures.not_logged_in;\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        const welcome = screen.queryByText(\"Welcome\");\n        expect(welcome).not.toBeInTheDocument();\n        const adminMenu = screen.queryByTestId(\"appnavbar-admin-dropdown\");\n        expect(adminMenu).not.toBeInTheDocument();\n    });\n\n    test(\"renders H2Console and Swagger links correctly\", async () => {\n        const currentUser = currentUserFixtures.adminUser;\n        const systemInfo = systemInfoFixtures.showingAll;\n\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findByText(\"H2Console\")).toBeInTheDocument();\n        const swaggerMenu = screen.getByText(\"Swagger\");\n        expect(swaggerMenu).toBeInTheDocument();        \n    });\n\n    test(\"renders the AppNavbarLocalhost when on http://localhost:3000\", async () => {\n        const currentUser = currentUserFixtures.userOnly;\n        const systemInfo = systemInfoFixtures.showingAll;\n        const doLogin = jest.fn();\n\n        delete window.location\n        window.location = new URL('http://localhost:3000')\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findByTestId(\"AppNavbarLocalhost\")).toBeInTheDocument();\n    });\n\n    test(\"renders the AppNavbarLocalhost when on http://127.0.0.1:3000\", async () => {\n        const currentUser = currentUserFixtures.userOnly;\n        const systemInfo = systemInfoFixtures.showingAll;\n        const doLogin = jest.fn();\n\n        delete window.location\n        window.location = new URL('http://127.0.0.1:3000')\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findByTestId(\"AppNavbarLocalhost\")).toBeInTheDocument();\n    });\n\n    test(\"does NOT render the AppNavbarLocalhost when on localhost:8080\", async () => {\n        const currentUser = currentUserFixtures.userOnly;\n        const systemInfo = systemInfoFixtures.showingAll;\n        const doLogin = jest.fn();\n\n        delete window.location\n        window.location = new URL('http://localhost:8080')\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findByTestId(\"AppNavbar\")).toBeInTheDocument();\n        expect(screen.queryByTestId(/AppNavbarLocalhost/i)).toBeNull();\n    });\n});\n"},"src/tests/utils/systemInfo.test.js":{"tests":[{"id":"22","name":"utils/systemInfo tests useSystemInfo tests useSystemInfo retrieves initial data","location":{"start":{"column":10,"line":15}}},{"id":"23","name":"utils/systemInfo tests useSystemInfo tests useSystemInfo retrieves data from API","location":{"start":{"column":10,"line":49}}},{"id":"24","name":"utils/systemInfo tests useSystemInfo tests systemInfo when API unreachable","location":{"start":{"column":10,"line":68}}}],"source":"import { renderHook } from '@testing-library/react-hooks';\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"jest-mock-console\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\n\nimport { useSystemInfo } from \"main/utils/systemInfo\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\njest.mock('react-router-dom');\nconst { _MemoryRouter } = jest.requireActual('react-router-dom');\n\ndescribe(\"utils/systemInfo tests\", () => {\n    describe(\"useSystemInfo tests\", () => {\n        test(\"useSystemInfo retrieves initial data\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/systemInfo\").timeoutOnce();\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n\n            const restoreConsole = mockConsole();\n\n            const { result, waitFor } = renderHook(() => useSystemInfo(), { wrapper });\n            await waitFor(() => result.current.isSuccess);\n\n            expect(result.current.data).toEqual({ \n                initialData:true,   \n                springH2ConsoleEnabled: false,\n                showSwaggerUILink: false  \n            });\n            \n            const queryState = queryClient.getQueryState(\"systemInfo\");\n            expect(queryState).toBeDefined();\n\n            queryClient.clear();\n\n            await waitFor( ()=> expect(console.error).toHaveBeenCalled() );\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error invoking axios.get:/);\n            restoreConsole();\n        });\n\n        test(\"useSystemInfo retrieves data from API\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingAll);\n\n            const { result, waitFor } = renderHook(() => useSystemInfo(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n\n            expect(result.current.data).toEqual(systemInfoFixtures.showingAll);\n            queryClient.clear();\n        });\n\n        test(\"systemInfo when API unreachable\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/systemInfo\").reply(404)\n\n            const restoreConsole = mockConsole();\n            const { result, waitFor } = renderHook(() => useSystemInfo(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n            expect(console.error).toHaveBeenCalled();\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error invoking axios.get:/);\n            restoreConsole();\n\n            expect(result.current.data).toEqual({  \n                springH2ConsoleEnabled: false,\n                showSwaggerUILink: false \n            });\n            queryClient.clear();\n        });\n    });\n});\n"},"src/tests/components/OurTable.test.js":{"tests":[{"id":"25","name":"OurTable tests renders an empty table without crashing","location":{"start":{"column":6,"line":43}}},{"id":"26","name":"OurTable tests TestHrefButtonColumn works as it should","location":{"start":{"column":6,"line":49}}},{"id":"27","name":"OurTable tests The button appears in the table","location":{"start":{"column":6,"line":58}}},{"id":"28","name":"OurTable tests default testid is testId","location":{"start":{"column":6,"line":69}}},{"id":"29","name":"OurTable tests click on a header and a sort caret should appear","location":{"start":{"column":6,"line":76}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport OurTable, { ButtonColumn, DateColumn, HrefButtonColumn, PlaintextColumn} from \"main/components/OurTable\";\n\ndescribe(\"OurTable tests\", () => {\n    const threeRows = [\n        {\n            col1: 'Hello',\n            col2: 'World',\n            createdAt: '2021-04-01T04:00:00.000',\n            log: \"foo\\nbar\\n  baz\",\n        },\n        {\n            col1: 'react-table',\n            col2: 'rocks',\n            createdAt: '2022-01-04T14:00:00.000',\n            log: \"foo\\nbar\",\n\n        },\n        {\n            col1: 'whatever',\n            col2: 'you want',\n            createdAt: '2023-04-01T23:00:00.000',\n            log: \"bar\\n  baz\",\n        }\n    ];\n    const clickMeCallback = jest.fn();\n\n    const columns = [\n        {\n            Header: 'Column 1',\n            accessor: 'col1', // accessor is the \"key\" in the data\n        },\n        {\n            Header: 'Column 2',\n            accessor: 'col2',\n        },\n        ButtonColumn(\"Click\", \"primary\", clickMeCallback, \"testId\"),\n        DateColumn(\"Date\", (cell) => cell.row.original.createdAt),\n        PlaintextColumn(\"Log\", (cell) => cell.row.original.log),\n        HrefButtonColumn(\"TestHrefButtonColumn\", \"primary\", \"/test\", \"testId\")\n    ];\n\n    test(\"renders an empty table without crashing\", () => {\n        render(\n            <"+"OurTable columns={columns} data={[]} />\n        );\n    });\n\n    test(\"TestHrefButtonColumn works as it should\", async () => {\n        render(\n            <"+"OurTable columns={columns} data={threeRows} />\n        );\n        expect(await screen.findByTestId(\"testId-cell-row-0-col-TestHrefButtonColumn-button\")).toBeInTheDocument();\n        const button = screen.getByTestId(\"testId-cell-row-0-col-TestHrefButtonColumn-button\");\n        expect(button).toHaveAttribute(\"href\", \"/test\");\n    });\n\n    test(\"The button appears in the table\", async () => {\n        render(\n            <"+"OurTable columns={columns} data={threeRows} />\n        );\n\n        expect(await screen.findByTestId(\"testId-cell-row-0-col-Click-button\")).toBeInTheDocument();\n        const button = screen.getByTestId(\"testId-cell-row-0-col-Click-button\");\n        fireEvent.click(button);\n        await waitFor(() => expect(clickMeCallback).toBeCalledTimes(1));\n    });\n\n    test(\"default testid is testId\", async () => {\n        render(\n            <"+"OurTable columns={columns} data={threeRows} />\n        );\n        expect(await screen.findByTestId(\"testid-header-col1\")).toBeInTheDocument();\n    });\n\n    test(\"click on a header and a sort caret should appear\", async () => {\n        render(\n            <"+"OurTable columns={columns} data={threeRows} testid={\"sampleTestId\"} />\n        );\n\n        expect(await screen.findByTestId(\"sampleTestId-header-col1\")).toBeInTheDocument();\n        const col1Header = screen.getByTestId(\"sampleTestId-header-col1\");\n\n        const col1SortCarets = screen.getByTestId(\"sampleTestId-header-col1-sort-carets\");\n        expect(col1SortCarets).toHaveTextContent('');\n\n        const col1Row0 = screen.getByTestId(\"sampleTestId-cell-row-0-col-col1\");\n        expect(col1Row0).toHaveTextContent(\"Hello\");\n\n        fireEvent.click(col1Header);\n        expect(await screen.findByText(\"\")).toBeInTheDocument();\n\n        fireEvent.click(col1Header);\n        expect(await screen.findByText(\"\")).toBeInTheDocument();\n    });\n});\n"},"src/tests/components/Jobs/TestJobsForm.test.js":{"tests":[{"id":"30","name":"TestJobsForm tests renders correctly with the right defaults","location":{"start":{"column":4,"line":14}}},{"id":"31","name":"TestJobsForm tests validates that sleepMs is present","location":{"start":{"column":4,"line":27}}},{"id":"32","name":"TestJobsForm tests validates that sleepMs is >= 0","location":{"start":{"column":4,"line":53}}},{"id":"33","name":"TestJobsForm tests validates that sleepMs is <"+"= 60000","location":{"start":{"column":4,"line":76}}}],"source":"import { fireEvent, render, screen } from \"@testing-library/react\";\nimport { MemoryRouter as Router } from \"react-router-dom\";\nimport TestJobsForm from \"main/components/Jobs/TestJobForm\";\nimport jobsFixtures from \"fixtures/jobsFixtures\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock('react-router-dom', () => ({\n  ...jest.requireActual('react-router-dom'),\n  useNavigate: () => mockedNavigate\n}));\n\ndescribe(\"TestJobsForm tests\", () => {\n  it(\"renders correctly with the right defaults\", async () => {\n    render(\n      <"+"Router >\n        <"+"TestJobsForm jobs={jobsFixtures.sixJobs}/>\n      <"+"/Router>\n    );\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n    expect(await screen.findByTestId(\"TestJobForm-sleepMs\")).toBeInTheDocument();\n    expect(screen.getByText(/Submit/)).toBeInTheDocument();\n  });\n\n\n  it(\"validates that sleepMs is present\", async () => {\n    const submitAction = jest.fn();\n\n    render(\n      <"+"Router  >\n        <"+"TestJobsForm jobs={jobsFixtures.sixJobs}/>\n      <"+"/Router  >\n    );\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"TestJobForm-Submit-Button\");\n    const sleepMs = screen.getByTestId(\"TestJobForm-sleepMs\");\n\n    expect(submitButton).toBeInTheDocument();\n    expect(sleepMs).toHaveValue(1000);\n\n\n    fireEvent.change(sleepMs, { target: { value: '' } })\n    fireEvent.click(submitButton);\n    expect(await screen.findByText(\"sleepMs is required (0 is ok)\")).toBeInTheDocument();\n    expect(submitAction).not.toBeCalled();\n    expect(screen.getByTestId(\"TestJobForm-sleepMs\")).toHaveClass(\"is-invalid\"); // tests for mutation to isInvalid={!!errors.sleepMs} idiom\n\n  });\n\n\n  it(\"validates that sleepMs is >= 0\", async () => {\n    const submitAction = jest.fn();\n\n    render(\n      <"+"Router  >\n        <"+"TestJobsForm jobs={jobsFixtures.sixJobs}/>\n      <"+"/Router  >\n    );\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"TestJobForm-Submit-Button\");\n    const sleepMs = screen.getByTestId(\"TestJobForm-sleepMs\");\n\n    expect(submitButton).toBeInTheDocument();\n    expect(sleepMs).toHaveValue(1000);\n\n    fireEvent.change(sleepMs, { target: { value: '-1' } })\n    fireEvent.click(submitButton);\n    expect(await screen.findByText(/sleepMs must be positive/i)).toBeInTheDocument();\n    expect(submitAction).not.toBeCalled();\n  });\n\n\n  it(\"validates that sleepMs is <"+"= 60000\", async () => {\n    const submitAction = jest.fn();\n\n    render(\n      <"+"Router  >\n        <"+"TestJobsForm jobs={jobsFixtures.sixJobs}/>\n      <"+"/Router  >\n    );\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"TestJobForm-Submit-Button\");\n    const sleepMs = screen.getByTestId(\"TestJobForm-sleepMs\");\n\n    expect(submitButton).toBeInTheDocument();\n    expect(sleepMs).toHaveValue(1000);\n\n    fireEvent.change(sleepMs, { target: { value: '70000' } })\n    fireEvent.click(submitButton);\n    expect(await screen.findByText(/sleepMs must be  60000/i)).toBeInTheDocument();\n    expect(submitAction).not.toBeCalled();\n  });\n});\n"},"src/tests/pages/AdminJobsPage.test.js":{"tests":[{"id":"34","name":"AdminJobsPage tests renders without crashing","location":{"start":{"column":4,"line":49}}},{"id":"35","name":"AdminJobsPage tests user can submit a test job","location":{"start":{"column":4,"line":64}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport AdminJobsPage from \"main/pages/AdminJobsPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport pagedJobsFixtures from \"fixtures/pagedJobsFixtures\";\n\nconst mockToast = jest.fn();\njest.mock('react-toastify', () => {\n    const originalModule = jest.requireActual('react-toastify');\n    return {\n        __esModule: true,\n        ...originalModule,\n        toast: (x) => mockToast(x)\n    };\n});\n\ndescribe(\"AdminJobsPage tests\", () => {\n  let queryClient = new QueryClient();\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    queryClient = new QueryClient();\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock.onGet(\"/api/jobs/all/pageable\").reply(200, pagedJobsFixtures.onePage);\n\n    // see: https://ucsb-cs156.github.io/topics/testing/testing_jest.html#hiding-the-wall-of-red\n    jest.spyOn(console, 'error')\n    console.error.mockImplementation(() => null);\n  });\n\n  afterEach(() => {\n     // see: https://ucsb-cs156.github.io/topics/testing/testing_jest.html#hiding-the-wall-of-red\n    console.error.mockRestore()\n  })\n\n\n  test(\"renders without crashing\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n    );\n    expect(await screen.findByText(\"Launch Jobs\")).toBeInTheDocument();\n    expect(await screen.findByText(\"Job Status\")).toBeInTheDocument();\n\n    expect(await screen.findByText(\"Test Job\")).toBeInTheDocument();\n   \n  });\n\n  test(\"user can submit a test job\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n    );\n\n    expect(await screen.findByText(\"Test Job\")).toBeInTheDocument();\n\n    const testJobButton = screen.getByText(\"Test Job\");\n    expect(testJobButton).toBeInTheDocument();\n    testJobButton.click();\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n\n    const sleepMsInput = screen.getByTestId(\"TestJobForm-sleepMs\");\n    const submitButton = screen.getByTestId(\"TestJobForm-Submit-Button\");\n\n    expect(sleepMsInput).toBeInTheDocument();\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.change(sleepMsInput, { target: { value: \"0\" } });\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(\n      \"/api/jobs/launch/testjob?fail=false&sleepMs=0\"\n    );\n\n    expect(mockToast).toHaveBeenCalledWith(\"Submitted job: Test Job\");\n  });\n});\n"},"src/tests/pages/ProfilePage.test.js":{"tests":[{"id":"36","name":"ProfilePage tests renders correctly for regular logged in user","location":{"start":{"column":6,"line":29}}},{"id":"37","name":"ProfilePage tests renders correctly for admin user from UCSB","location":{"start":{"column":6,"line":57}}},{"id":"38","name":"ProfilePage tests renders correct content when not logged in","location":{"start":{"column":6,"line":72}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport ProfilePage from \"main/pages/ProfilePage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\ndescribe(\"ProfilePage tests\", () => {\n    const queryClient = new QueryClient();\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n\n        jest.spyOn(console, 'error')\n        console.error.mockImplementation(() => null);\n    });\n\n    afterEach(() => {\n        jest.clearAllMocks();\n    })\n\n    test(\"renders correctly for regular logged in user\", async () => {\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"ProfilePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n        await screen.findAllByText(\"User Profile for cgaucho\");\n        const header = screen.getByText(\"User Profile for cgaucho\");\n        expect(header).toHaveClass(\"mb-3\");\n\n        expect(screen.queryByText(\"Not logged in.\")).not.toBeInTheDocument();\n        expect(screen.getByText(\"Emails\")).toBeInTheDocument();\n\n        const emailsHeader = screen.getByText(\"Emails\");\n        expect(emailsHeader).toHaveClass(\"mt-3\");\n        expect(emailsHeader).toHaveClass(\"mb-3\");\n\n        const debuggingInfoHeader = screen.getByText(\"Debugging Information\");\n        expect(debuggingInfoHeader).toHaveClass(\"mt-3\");\n        expect(debuggingInfoHeader).toHaveClass(\"mb-3\");\n\n        expect(screen.getByTestId(\"UsersTable-cell-row-0-col-githubLogin\")).toBeInTheDocument();\n        expect(screen.getByTestId(\"UsersTable-cell-row-0-col-githubLogin\")).toHaveTextContent(\"cgaucho\");\n\n    });\n\n    test(\"renders correctly for admin user from UCSB\", async () => {\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.adminUser);\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"ProfilePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findAllByText(\"root\")).toHaveLength(2);\n        expect(screen.queryByText(\"Not logged in.\")).not.toBeInTheDocument();\n    });\n\n    test(\"renders correct content when not logged in\", async () => {\n        axiosMock.onGet(\"/api/currentUser\").reply(403);\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"ProfilePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByText(\"Not logged in.\");\n\n    });\n});\n"},"src/tests/utils/users.test.js":{"tests":[{"id":"39","name":"utils/users tests useUsers tests useUsers initially retrieves initial data on timeout","location":{"start":{"column":10,"line":14}}},{"id":"40","name":"utils/users tests useUsers tests useUsers hits error logic on 404","location":{"start":{"column":10,"line":41}}},{"id":"41","name":"utils/users tests useUsers tests useUsers returns correct data when api is mocked","location":{"start":{"column":10,"line":62}}}],"source":"import { renderHook } from '@testing-library/react-hooks';\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"jest-mock-console\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\n\nimport { useUsers } from \"main/utils/users\";\nimport usersFixtures from \"fixtures/usersFixtures\";\n\njest.mock('react-router-dom');\n\ndescribe(\"utils/users tests\", () => {\n    describe(\"useUsers tests\", () => {\n        test(\"useUsers initially retrieves initial data on timeout\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/admin/users\").timeout();\n\n            const restoreConsole = mockConsole();\n\n            const { result, waitFor } = renderHook(() => useUsers(), { wrapper });\n\n            await waitFor(() => result.current.isSuccess);\n            expect(result.current.data).toEqual([]);\n\n            const queryState = queryClient.getQueryState(\"users\");\n            expect(queryState).toBeDefined();\n\n            await waitFor(() => expect(console.error).toHaveBeenCalled());\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(\"Error getting data from /api/admin/users:\");\n            restoreConsole();\n        });\n\n        test(\"useUsers hits error logic on 404\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/admin/users\").reply(404);\n\n            const restoreConsole = mockConsole();\n\n            const { result, waitFor } = renderHook(() => useUsers(), { wrapper });\n            await waitFor(() => result.current.isFetched);\n            expect(console.error).toHaveBeenCalled();\n            restoreConsole();\n\n            expect(result.current.data).toEqual([]);\n        });\n\n        test(\"useUsers returns correct data when api is mocked\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n            var axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/admin/users\").reply(200, usersFixtures.threeUsers);\n\n            const { result, waitFor } = renderHook(() => useUsers(), { wrapper });\n            await waitFor(() => result.current.isFetched);\n            expect(result.current.data).toEqual(usersFixtures.threeUsers);\n        });\n    });\n});\n"},"src/tests/utils/dateUtils.test.js":{"tests":[{"id":"42","name":"dateUtils tests padWithZero tests pads when less than 10","location":{"start":{"column":6,"line":8}}},{"id":"43","name":"dateUtils tests padWithZero tests does not pad with 10 or greater","location":{"start":{"column":6,"line":15}}},{"id":"44","name":"dateUtils tests timestampToDate tests converts properly","location":{"start":{"column":6,"line":23}}},{"id":"45","name":"dateUtils tests daysSinceTimestamp tests calculates days properly","location":{"start":{"column":6,"line":29}}},{"id":"46","name":"dateUtils tests formatTime tests should return empty string for null input","location":{"start":{"column":6,"line":36}}},{"id":"47","name":"dateUtils tests formatTime tests should return `Online now` for less than 2 minutes","location":{"start":{"column":6,"line":40}}},{"id":"48","name":"dateUtils tests formatTime tests should return minutes ago format","location":{"start":{"column":6,"line":45}}},{"id":"49","name":"dateUtils tests formatTime tests should return hours ago format","location":{"start":{"column":6,"line":50}}},{"id":"50","name":"dateUtils tests formatTime tests should return 1 hour ago for 1 hour","location":{"start":{"column":6,"line":55}}},{"id":"51","name":"dateUtils tests formatTime tests should return days ago format","location":{"start":{"column":6,"line":60}}},{"id":"52","name":"dateUtils tests formatTime tests should return 1 day ago for 1 day","location":{"start":{"column":6,"line":65}}},{"id":"53","name":"dateUtils tests formatTime tests should return date string for over a week","location":{"start":{"column":6,"line":70}}}],"source":"import { padWithZero, timestampToDate, daysSinceTimestamp, formatTime } from \"main/utils/dateUtils\";\n\n\ndescribe(\"dateUtils tests\", () => {\n\n  describe(\"padWithZero tests\", () => {\n\n    test(\"pads when less than 10\", () => {\n      expect(padWithZero(0)).toBe(\"00\");\n      expect(padWithZero(1)).toBe(\"01\");\n      expect(padWithZero(9)).toBe(\"09\");\n\n    });\n\n    test(\"does not pad with 10 or greater\", () => {\n      expect(padWithZero(10)).toBe(10);\n      expect(padWithZero(11)).toBe(11);\n    });\n\n  });\n\n  describe(\"timestampToDate tests\", () => {\n    it(\"converts properly\", () => {\n      expect(timestampToDate(1653346250816)).toBe(\"2022-05-23\");\n    });\n  });\n\n  describe(\"daysSinceTimestamp tests\", () => {\n    it(\"calculates days properly\", () => {\n      jest.useFakeTimers().setSystemTime(new Date('2022-06-01'));\n      expect(daysSinceTimestamp(1653346250816)).toBe(9);\n    });\n  });\n\n  describe(\"formatTime tests\", () => {\n    it('should return empty string for null input', () => {\n      expect(formatTime(null)).toEqual('');\n    });\n\n    it('should return `Online now` for less than 2 minutes', () => {\n      const oneMinuteAgo = new Date(Date.now() - 60 * 1000).toISOString();\n      expect(formatTime(oneMinuteAgo)).toEqual('Online now');\n    });\n  \n    it('should return minutes ago format', () => {\n      const thirtyMinutesAgo = new Date(Date.now() - 2 * 60 * 1000).toISOString();\n      expect(formatTime(thirtyMinutesAgo)).toEqual('2 minutes ago');\n    });\n  \n    it('should return hours ago format', () => {\n      const threeHoursAgo = new Date(Date.now() - 3 * 60 * 60 * 1000).toISOString();\n      expect(formatTime(threeHoursAgo)).toEqual('3 hours ago');\n    });\n  \n    it('should return 1 hour ago for 1 hour', () => {\n      const oneHourAgo = new Date(Date.now() - 60 * 60 * 1000).toISOString();\n      expect(formatTime(oneHourAgo)).toEqual('1 hour ago');\n    });\n  \n    it('should return days ago format', () => {\n      const twoDaysAgo = new Date(Date.now() - 2 * 24 * 60 * 60 * 1000).toISOString();\n      expect(formatTime(twoDaysAgo)).toEqual('2 days ago');\n    });\n  \n    it('should return 1 day ago for 1 day', () => {\n      const oneDayAgo = new Date(Date.now() - 24 * 60 * 60 * 1000).toISOString();\n      expect(formatTime(oneDayAgo)).toEqual('1 day ago');\n    });\n  \n    it('should return date string for over a week', () => {\n      const twoWeeksAgo = new Date(Date.now() - 7 * 24 * 60 * 60 * 1000);\n      expect(formatTime(twoWeeksAgo.toISOString())).toEqual(twoWeeksAgo.toLocaleDateString());\n    });\n  })\n});\n"},"src/tests/components/Jobs/JobsTable.test.js":{"tests":[{"id":"54","name":"JobsTable tests renders without crashing for empty table","location":{"start":{"column":4,"line":10}}},{"id":"55","name":"JobsTable tests Has the expected column headers and content","location":{"start":{"column":4,"line":23}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport JobsTable from \"main/components/Jobs/JobsTable\";\nimport jobsFixtures from \"fixtures/jobsFixtures\";\n\ndescribe(\"JobsTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders without crashing for empty table\", () => {\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={[]}  />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n\n    );\n  });\n\n\n  test(\"Has the expected column headers and content\", () => {\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={jobsFixtures.sixJobs}  />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n\n    );\n\n    const expectedHeaders = ['id', 'Created', 'Updated', 'Status', 'Log'];\n    const expectedFields = ['id', 'Created', 'Updated','status', 'Log'];\n    const testId = \"JobsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"1\");\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-Created`)).toHaveTextContent(\"11/13/2022, 19:49:58\");\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-Updated`)).toHaveTextContent(\"11/13/2022, 19:49:59\");\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-status`)).toHaveTextContent(\"complete\");\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-Log`)).toHaveTextContent(\"Hello World! from test job!Goodbye from test job!\");\n\n    expect(screen.getByTestId(`JobsTable-header-id-sort-carets`)).toHaveTextContent(\"\");\n\n\n  });\n\n});\n\n"},"src/tests/components/Users/UsersTable.test.js":{"tests":[{"id":"56","name":"UserTable tests renders without crashing for empty table","location":{"start":{"column":6,"line":7}}},{"id":"57","name":"UserTable tests renders without crashing for three users","location":{"start":{"column":6,"line":13}}},{"id":"58","name":"UserTable tests Has the expected colum headers and content","location":{"start":{"column":6,"line":19}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport UsersTable from \"main/components/Users/UsersTable\";\nimport { formatTime } from \"main/utils/dateUtils\";\nimport usersFixtures from \"fixtures/usersFixtures\";\n\ndescribe(\"UserTable tests\", () => {\n    test(\"renders without crashing for empty table\", () => {\n        render(\n            <"+"UsersTable users={[]} />\n        );\n    });\n\n    test(\"renders without crashing for three users\", () => {\n        render(\n            <"+"UsersTable users={usersFixtures.threeUsers} />\n        );\n    });\n\n    test(\"Has the expected colum headers and content\", () => {\n        render(\n          <"+"UsersTable users={usersFixtures.threeUsers}/>\n        );\n    \n        const expectedHeaders = [\"githubId\", \"githubLogin\", \"fullName\", \"Email\", \"Last Online\", \"Admin\"];\n        const expectedFields = [\"githubId\", \"githubLogin\", \"fullName\", \"email\", \"lastOnline\", \"admin\"];\n        const testId = \"UsersTable\";\n\n        expectedHeaders.forEach( (headerText)=> {\n            const header = screen.getByText(headerText);\n            expect(header).toBeInTheDocument();\n        });\n\n        expectedFields.forEach( (field)=> {\n          const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n          expect(header).toBeInTheDocument();\n        });\n\n        expect(screen.getByTestId(`${testId}-cell-row-0-col-githubId`)).toHaveTextContent(\"11111\");\n        expect(screen.getByTestId(`${testId}-cell-row-0-col-admin`)).toHaveTextContent(\"true\");\n        expect(screen.getByTestId(`${testId}-cell-row-0-col-fullName`)).toHaveTextContent(\"Phill Conrad\");\n        expect(screen.getByTestId(`${testId}-cell-row-0-col-lastOnline`)).toHaveTextContent(formatTime(usersFixtures.threeUsers[0].lastOnline));\n        expect(screen.getByTestId(`${testId}-cell-row-1-col-githubLogin`)).toHaveTextContent(\"cgaucho\");\n        expect(screen.getByTestId(`${testId}-cell-row-1-col-admin`)).toHaveTextContent(\"false\");\n      });\n});\n"},"src/tests/utils/arrayUtils.test.js":{"tests":[{"id":"59","name":"arrayUtils tests getFirstSmallestLargest abbr","location":{"start":{"column":4,"line":39}}},{"id":"60","name":"arrayUtils tests getFirstSmallestLargest name","location":{"start":{"column":4,"line":49}}},{"id":"61","name":"arrayUtils tests getFirstSmallestLargest symbols.bird","location":{"start":{"column":4,"line":59}}},{"id":"62","name":"arrayUtils tests getFirstSmallestLargest symbols.flower","location":{"start":{"column":4,"line":69}}}],"source":"import { getFirstSmallestLargest } from \"main/utils/arrayUtils\";\n\ndescribe(\"arrayUtils tests\", () => {\n  const states = [\n    {\n      abbr: \"CA\",\n      name: \"California\",\n      symbols: {\n        bird: \"California Quail\",\n        flower: \"California Poppy\",\n      },\n    },\n    {\n      abbr: \"OR\",\n      name: \"Oregon\",\n      symbols: {\n        bird: \"Western Meadowlark\",\n        flower: \"Oregon Grape\",\n      },\n    },\n    {\n      abbr: \"NV\",\n      name: \"Nevada\",\n      symbols: {\n        bird: \"Mountain Bluebird\",\n        flower: \"Big Sagebrush\",\n      },\n    },\n    {\n      abbr: \"AK\",\n      name: \"Alaska\",\n      symbols: {\n        bird: \"Willow ptarmigan\",\n        flower: \"Forget-me-not\",\n      },\n    },\n  ];\n\n  test(\"getFirstSmallestLargest abbr\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.abbr\n    );\n    expect(first).toBe(\"CA\");\n    expect(smallest).toBe(\"AK\");\n    expect(largest).toBe(\"OR\");\n  });\n\n  test(\"getFirstSmallestLargest name\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.name\n    );\n    expect(first).toBe(\"California\");\n    expect(smallest).toBe(\"Alaska\");\n    expect(largest).toBe(\"Oregon\");\n  });\n\n  test(\"getFirstSmallestLargest symbols.bird\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.symbols.bird\n    );\n    expect(first).toBe(\"California Quail\");\n    expect(smallest).toBe(\"California Quail\");\n    expect(largest).toBe(\"Willow ptarmigan\");\n  });\n\n  test(\"getFirstSmallestLargest symbols.flower\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.symbols.flower\n    );\n    expect(first).toBe(\"California Poppy\");\n    expect(smallest).toBe(\"Big Sagebrush\");\n    expect(largest).toBe(\"Oregon Grape\");\n  });\n});\n"},"src/tests/pages/LoginPage.test.js":{"tests":[{"id":"63","name":"LoginPage tests renders without crashing when lists return empty list","location":{"start":{"column":6,"line":21}}},{"id":"64","name":"LoginPage tests renders html elements","location":{"start":{"column":6,"line":38}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport LoginPage from \"main/pages/LoginPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\ndescribe(\"LoginPage tests\", () => {\n    const queryClient = new QueryClient();\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    });\n\n    test(\"renders without crashing when lists return empty list\", () => {\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        axiosMock.onGet(\"/api/commons/all\").reply(200, []);\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"LoginPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        const title = screen.getByTestId(\"loginPage-cardTitle\");\n        expect(title).toBeInTheDocument();\n        expect(typeof (title.textContent)).toBe('string');\n        expect(title.textContent).toEqual('Welcome to Organic!');\n    });\n\n    test(\"renders html elements\", () => {\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"LoginPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n    });\n});\n"},"src/tests/pages/LoadingPage.test.js":{"tests":[{"id":"65","name":"LoadingPage tests renders without crashing when lists return empty list","location":{"start":{"column":6,"line":31}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport LoadingPage from \"main/pages/LoadingPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nconst mockNavigate = jest.fn();\njest.mock(\"react-router-dom\", () => ({\n    ...jest.requireActual(\"react-router-dom\"),\n    useParams: () => ({\n        commonsId: 1\n    }),\n    useNavigate: () => mockNavigate\n}));\n\ndescribe(\"LoadingPage tests\", () => {\n    const queryClient = new QueryClient();\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n        jest.clearAllMocks();\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    });\n\n    test(\"renders without crashing when lists return empty list\", () => {\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        axiosMock.onGet(\"/api/commons/all\").reply(200, []);\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"LoadingPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        const mainDiv = screen.getByTestId(\"LoadingPage-main-div\");\n        expect(mainDiv).toBeInTheDocument();\n\n    });\n\n});"},"src/tests/pages/HomePage.test.js":{"tests":[{"id":"66","name":"HomePage tests expected CSS properties","location":{"start":{"column":6,"line":31}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport HomePage from \"main/pages/HomePage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nconst mockNavigate = jest.fn();\njest.mock(\"react-router-dom\", () => ({\n    ...jest.requireActual(\"react-router-dom\"),\n    useParams: () => ({\n        commonsId: 1\n    }),\n    useNavigate: () => mockNavigate\n}));\n\ndescribe(\"HomePage tests\", () => {\n    const queryClient = new QueryClient();\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n        jest.clearAllMocks();\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    });\n\n    test(\"expected CSS properties\", () => {\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"HomePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        const title = screen.getByTestId(\"homePage-title\");\n        expect(title).toHaveAttribute(\"style\", \"font-size: 75px; border-radius: 7px; background-color: white; opacity: 0.9;\");\n    });\n\n});"},"src/tests/components/Nav/Footer.test.js":{"tests":[{"id":"67","name":"Footer tests renders correctly","location":{"start":{"column":6,"line":6}}},{"id":"68","name":"Footer tests renders correctly when systemInfo.showingNeither","location":{"start":{"column":6,"line":23}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport Footer from \"main/components/Nav/Footer\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\ndescribe(\"Footer tests\", () => {\n    test(\"renders correctly\", async () => {\n        render(\n            <"+"Footer systemInfo={systemInfoFixtures.showingAll}/>\n        );\n\n        const expectedText = \"Organic is a project ofCS156, a course at UC Santa Barbara.  It's purpose: provide students and instructors with useful tools to manage Github organizations associated with programming and software engineering courses. The open source code is available on GitHub.\";\n\n        \n        const text = screen.getByTestId(\"footer-content\");\n        expect(text).toBeInTheDocument();\n        expect(typeof(text.textContent)).toBe('string');\n        expect(text.textContent).toEqual(expectedText);\n        \n        const href = screen.getByTestId(\"github-href\");\n        expect(href).toHaveAttribute(\"href\", \"https://github.com/ucsb-cs156/proj-organic\");\n    });\n\n    test(\"renders correctly when systemInfo.showingNeither\", async () => {\n        render(\n            <"+"Footer/>\n        );\n\n        const text = screen.getByTestId(\"footer-content\");\n        expect(text).toBeInTheDocument();\n            \n        const href = screen.getByTestId(\"github-href\");\n        expect(href.href).toBe(\"\");\n    });\n});\n"},"src/tests/components/Utils/Plaintext.test.js":{"tests":[{"id":"69","name":"Plaintext tests renders the correct text","location":{"start":{"column":6,"line":5}}},{"id":"70","name":"Plaintext tests works on null parameter","location":{"start":{"column":6,"line":23}}},{"id":"71","name":"Plaintext tests works on non-text types","location":{"start":{"column":6,"line":38}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport Plaintext from \"main/components/Utils/Plaintext\"\n\ndescribe(\"Plaintext tests\", () => {\n    test(\"renders the correct text\", async () => {\n        // Arrange\n        const text = \"foo\\nbar\\n  baz\"\n\n        const [firstLine, ...rest] = text.split('\\n')\n\n        // Act\n        render(\n            <"+"Plaintext text={text}  />\n        );\n\n        // Assert\n        expect(await screen.findByText(firstLine)).toBeInTheDocument();\n        rest.forEach(line => {\n            expect(screen.getByText(line.trim())).toBeInTheDocument();\n        });\n    });\n\n    test(\"works on null parameter\", async () => {\n        // Arrange\n      \n        // Act\n        render(\n            <"+"Plaintext text={null}  />\n        );\n\n        // Assert\n        expect(await screen.findByTestId(\"plaintext-empty\")).toBeInTheDocument();\n        const pre = screen.getByTestId(\"plaintext-empty\");\n        expect(pre).toHaveTextContent(\"\");\n    });\n\n\n    test(\"works on non-text types\", async () => {\n        // Arrange\n      \n        // Act\n        render(\n            <"+"Plaintext text={[30, \"foo\", true]}  />\n        );\n\n        // Assert\n        expect(await screen.findByTestId(\"plaintext\")).toBeInTheDocument();\n        const pre = screen.getByTestId(\"plaintext\");\n        expect(pre).toHaveTextContent('[ 30, \"foo\", true]');\n    });\n});\n"},"src/tests/pages/AdminUsersPage.test.js":{"tests":[{"id":"72","name":"AdminUsersPage tests renders without crashing on two users","location":{"start":{"column":6,"line":26}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport AdminUsersPage from \"main/pages/AdminUsersPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport usersFixtures from \"fixtures/usersFixtures\";\n\ndescribe(\"AdminUsersPage tests\",  () => {\n    const queryClient = new QueryClient();\n\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(()=>{\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\
